import React, {useState, useEffect} from 'react';

const SignUpForm = () => {

    const [dataImg, setDataImg] = useState();

    useEffect(() => {
            fetch('https://api.thecatapi.com/v1/images/search')
            .then(response => {
                console.log(response);
                return response.json();
            })
            .then(data => {
                console.log(data);
                setDataImg(data[0])
            })
    }, [])


    return(
        <div>
            <p> S'inscrire </p> 


        </div>
    );
};

export default SignUpForm;
